import React from "react";
import ReactDOM from "react-dom";

var name = "Maninder";

ReactDOM.render(
  <>
    <h3>My Name is { name }</h3>
    <h4>Addition is { 4*3 }</h4>
  </>,
  document.getElementById("root")
);
